import React from "react";
import img1 from '../images/arijit.png';
import img2 from '../images/aujla.png';
import img3 from '../images/shreya.png';
import img4 from '../images/neha.png';
//import img5 from '../images/aujla1.png';
import './live.css';

const Live=()=>{

    return(
        <div className="upper">
        
           
                
                <img src={img1} alt=""/>
               
            
            
                
               
                <img src={img2} alt=""/>
          


                
                <img src={img3} alt=""/>
               
           
            
                
                <img src={img4} alt=""/>
          

        </div>
    )
}
export default Live;
